import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const WelcomeButton = () => {
    return (
        <button className="welcome-button">
            Bienvenido
        </button>
    );
};

ReactDOM.render(
    <React.StrictMode>
        <App />
        <WelcomeButton />
    </React.StrictMode>,
    document.getElementById('root')
);
